import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="home-page">
      <section className="hero">
        <h1>Найдите свою вторую половинку</h1>
        <p>Познакомьтесь с интересными людьми в вашем городе</p>
        <Link to="/profiles" className="cta-button">
          Смотреть анкеты
        </Link>
      </section>
      
      <section className="features">
        <div className="feature-card">
          <h3>Простой поиск</h3>
          <p>Используйте фильтры для поиска подходящих людей</p>
        </div>
        <div className="feature-card">
          <h3>Подробные анкеты</h3>
          <p>Узнайте больше о человеке перед знакомством</p>
        </div>
        <div className="feature-card">
          <h3>Безопасность</h3>
          <p>Все анкеты проверяются администрацией</p>
        </div>
      </section>
    </div>
  );
};

export default HomePage;
